"use strict";userApprovalMod.service("UserApprovalService",["$rootScope","$http",function(a,b){this.getCountries=function(){return b.get(a.contextPath+"/user/getCountries")};this.getEnrolledUserDetails=function(c){console.log("in user approval service get user details :: "+c.length);var d={enrollmentToken:c};return b.post(a.contextPath+"/user/getUserDetailsForApproval",d)};this.approveUser=function(c){return b.post(a.contextPath+"/user/approveEnrolledUser",c)};this.rejectUser=function(c){return b.post(a.contextPath+"/user/rejectEnrolledUser",c)}}]);